function CheckListDevolucao() {
    let itens = []

    const HandleChange = (e) => {
        // to get the checked value
        const checkedValue = e.target.value;

        if (!itens.includes(checkedValue)) {
            itens.push(checkedValue)
        } else itens = itens.filter(item => item !== checkedValue)
    };

    return (
        <div>
            <input
                type="checkbox"
                name={`element1`}
                value={`element1`}
                onChange={this.HandleChange()}
            />
            <label for="element" style={{ fontSize: 35 }}>
                {`element1`}
            </label>

            <input
                type="checkbox"
                name={`element2`}
                value={`element2`}
                onChange={this.HandleChange()}
            />
            <label for="element" style={{ fontSize: 35 }}>
                {`element2`}
            </label>
        </div>
    )

}


export default CheckListDevolucao;
